import classes from './SubjectContentDivMargined.module.css';
import CourseTitleBar from './CourseTitleBar';




const SubjectContentDivMargined =()=>{



const  Course1={      courseName:"Classial Mechanics-I",
         courseNameColor:"var(--themeColor)",
         borderColor:"var(--headerRightIconsColor)",
         infoBarBkgColor:"#e0ebff",
         boxBkgColor:"white",
         courseSignUpstatusColor:"green",
         courseSwitchText:"You are in this course",
         courseSwitchTextColor:"var(--themeColor)",
         progressBarColor:"#50C878",
        }











return (<div className={classes.subjectContentDivMargined}>


  <CourseTitleBar Course={Course1}/>


</div>);

}

export default SubjectContentDivMargined;
